demo.repl.help:
Kòmand ki disponib:
  @show              ─ montre dènye rezime kat adaptatif la
  @json              ─ pwodui valè JSON brit ki resevwa nan flow la
  @back              ─ retounen nan kat/antre bloke anvan an
  @input <k>=<v>     ─ mete oswa ranplase yon chan antre
  @click <action_id> ─ soumèt kat la ak aksyon yo bay la
  @help              ─ afiche tèks èd sa a
  @quit              ─ soti nan REPL la
